import React, { useState } from 'react';
import { MOCK_SINGLE_RESULT } from '../data/mockData';

const SingleAnalysis = () => {
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [jobTitle, setJobTitle] = useState('');
  const [jobDescription, setJobDescription] = useState('');

  const handleSubmit = () => {
    if (!jobTitle.trim() || !jobDescription.trim()) {
      alert('Please fill in all required fields.');
      return;
    }

    setLoading(true);
    setResults(null);

    // Simulate API call delay
    setTimeout(() => {
      setResults(MOCK_SINGLE_RESULT);
      setLoading(false);
    }, 2000);
  };

  return (
    <div className="grid lg-grid-cols-2" style={{ gap: '1.5rem' }}>
      <div className="card">
        <h2 className="text-2xl font-bold text-gray-900 mb-6">Enter Job Information</h2>
        <div className="space-y-6">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Job Title
            </label>
            <input
              type="text"
              value={jobTitle}
              onChange={(e) => setJobTitle(e.target.value)}
              placeholder="e.g., Senior Cybersecurity Analyst"
              className="input"
            />
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Job Description
            </label>
            <textarea
              value={jobDescription}
              onChange={(e) => setJobDescription(e.target.value)}
              placeholder="Enter detailed job responsibilities, requirements, and qualifications..."
              rows="6"
              className="textarea"
            />
          </div>
          <button
            onClick={handleSubmit}
            disabled={loading}
            className={`btn btn-primary ${loading ? 'opacity-60 cursor-not-allowed' : ''}`}
            style={{ width: '100%' }}
          >
            {loading ? (
              <div className="flex items-center justify-center">
                <div className="spinner animate-spin mr-2"></div>
                Analyzing...
              </div>
            ) : (
              'Analyze Job Description'
            )}
          </button>
        </div>
      </div>

      <div className="card">
        <h2 className="text-2xl font-bold text-gray-900 mb-6">Analysis Results</h2>
        {loading ? (
          <div className="flex items-center justify-center py-12">
            <div className="text-center">
              <div className="spinner-lg animate-spin mb-4" style={{ margin: '0 auto' }}></div>
              <p className="text-gray-600">Processing your job description...</p>
            </div>
          </div>
        ) : results ? (
          <div className="space-y-6">
            <div className="rounded-lg p-4 border border-green-200" 
                 style={{ background: 'linear-gradient(to right, #f0fdf4, #eff6ff)' }}>
              <h3 className="text-lg font-semibold text-gray-900 mb-2">Predicted Category:</h3>
              <p className="text-2xl font-bold text-green-600 mb-2">
                {results.prediction.category_name}
              </p>
              <p className="text-gray-700 text-sm">
                {results.prediction.category_description}
              </p>
            </div>

            <div>
              <h3 className="text-lg font-semibold text-gray-900 mb-3">
                Extracted Skills ({results.skills.skill_count}):
              </h3>
              <div className="flex flex-wrap" style={{ gap: '0.5rem' }}>
                {results.skills.extracted_skills.map((skill, index) => (
                  <span key={index} className="skill-tag">
                    {skill}
                  </span>
                ))}
              </div>
            </div>

            <div className="bg-gray-50 rounded-lg p-4">
              <p className="text-sm text-gray-600">
                <strong>Analysis Mode:</strong> {results.model_info.mode} | 
                <strong> Processed:</strong> {new Date(results.model_info.timestamp).toLocaleString()}
              </p>
            </div>
          </div>
        ) : (
          <div className="flex items-center justify-center py-12">
            <div className="text-center">
              <div className="bg-gray-100 rounded-full p-6 mb-4 flex items-center justify-center"
                   style={{ width: '6rem', height: '6rem', margin: '0 auto 1rem' }}>
                <svg style={{ width: '2rem', height: '2rem', color: '#9ca3af' }} fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
                </svg>
              </div>
              <p className="text-gray-600">Submit job information to see detailed analysis results</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}
